webpackJsonp([1239],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-arrayprototypeshift.json":function(e,a){e.exports={data:{markdownRemark:{html:'<p>The JavaScript array method <code>.shift()</code> will remove the first element from an array and return that value. This will also change the length of the array</p>\n<p><strong>Syntax</strong></p>\n<pre><code>var array = [1, 2, 3, 4];\narray.shift();\n</code></pre>\n<h2>Description</h2>\n<p><code>.shift()</code> will remove the element at index 0 of the array upon which it is called. It then returns the removed value and shifts all remaining elements down by 1 index value.</p>\n<p><code>.shift()</code> will return <code>undefined</code> if the array it is called on contains no elements.</p>\n<h2>Examples</h2>\n<p><strong>Shifting the first value from an array</strong></p>\n<pre><code>var array = [1, 2, 3, 4, 5];\nconsole.log(array);\n// Console will output 1, 2, 3, 4, 5\n\narray.shift();\n// If we console.log(array.shift()); the console would output 1.\n\nconsole.log(array);\n/* Console will output 2, 3, 4, 5 and \nthe variable array now contains the set [2, 3, 4, 5] where \neach element has been moved down 1 index value. */\n</code></pre>\n<p>Source <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/shift">MDN</a></p>',frontmatter:{title:"javaScript Arrayprototypeshift",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-arrayprototypeshift/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-arrayprototypeshift/"}}}});
